import React, { useState } from "react";
import loginImage from "../assets/login2.jpeg"; // Put your image in src/assets/

const Login = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [message, setMessage] = useState("");

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await fetch("http://127.0.0.1:5000/login", {
        method: "POST",
        credentials: "include",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password }),
      });
      const data = await res.json();
      if (data.success) {
        setMessage(`✅ Logged in as ${data.user}`);
        window.location.href = "/index";
      } else {
        setMessage("❌ " + data.message);
      }
    } catch (err) {
      console.error(err);
      setMessage("❌ Server Error: " + err.message);
    }
  };

  return (
    <div style={{
      height: "100vh",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      background: "linear-gradient(135deg, #6e8efb, #a777e3)",
      fontFamily: "Poppins, sans-serif"
    }}>
      <div style={{
        display: "flex",
        width: 900,
        height: 550,
        borderRadius: 12,
        overflow: "hidden",
        boxShadow: "0 10px 25px rgba(0,0,0,0.15)",
        background: "#fff"
      }}>
        {/* Left side */}
        <div style={{ flex: 1, padding: 50, display: "flex", flexDirection: "column", justifyContent: "center" }}>
          <div style={{ display: "flex", alignItems: "center", gap: 8, marginBottom: 30 }}>
            <div style={{ width: 32, height: 32, borderRadius: 8, background: "#6e8efb" }}></div>
            <div style={{ fontWeight: 600, fontSize: 18, color: "#333" }}>PMA</div>
          </div>
          <h2 style={{ fontSize: 32, marginBottom: 25, color: "#222" }}>Welcome Back</h2>

          {message && <div style={{ marginBottom: 12, padding: 8, borderRadius: 6, background: message.includes("✅") ? "#2ecc71" : "#e74c3c", color: "#fff" }}>{message}</div>}

          <form onSubmit={handleLogin}>
            <label style={{ display: "block", marginBottom: 6, fontSize: 14, color: "#444" }}>Username</label>
            <input type="text" value={username} onChange={e => setUsername(e.target.value)} placeholder="Enter your username" style={{ width: "100%", padding: 12, borderRadius: 8, border: "1px solid #ccc", marginBottom: 16 }} required />

            <label style={{ display: "block", marginBottom: 6, fontSize: 14, color: "#444" }}>Password</label>
            <input type="password" value={password} onChange={e => setPassword(e.target.value)} placeholder="Enter your password" style={{ width: "100%", padding: 12, borderRadius: 8, border: "1px solid #ccc", marginBottom: 16 }} required />

            <div style={{ display: "flex", justifyContent: "space-between", fontSize: 13, marginBottom: 20 }}>
              <label>Keep me logged in</label>
              <a href="#" style={{ color: "#6e8efb", textDecoration: "none" }}>Forgot your password?</a>
            </div>

            <button type="submit" style={{ width: "100%", padding: 12, borderRadius: 8, background: "#6e8efb", color: "#fff", fontWeight: 600, fontSize: 15, cursor: "pointer" }}>Log In</button>
          </form>

          <div style={{ textAlign: "center", marginTop: 20, fontSize: 14 }}>
            Don’t have an account? <a href="/register" style={{ color: "#6e8efb", fontWeight: 500, textDecoration: "none" }}>Sign up</a>
          </div>
        </div>

        {/* Right side */}
        <div style={{ flex: 1, background: "#f8f9ff", display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center", textAlign: "center", padding: 30 }}>
          <img src={loginImage} alt="Illustration" style={{ width: "75%", maxWidth: 320, marginBottom: 20 }} />
          <h3 style={{ fontSize: 20, color: "#333", marginBottom: 10 }}>Welcome to Property Management App</h3>
          <p style={{ fontSize: 14, color: "#666", width: "80%", margin: "0 auto", lineHeight: 1.5 }}>Manage your property and tenants easily from anywhere, anytime. Stay connected and efficient.</p>
        </div>
      </div>
    </div>
  );
};

export default Login;
